  return (
    <>
      {/* <div
        style={{
          backgroundImage: `url(${background})`,
          width: "98.9vw",
          height: "100vh",
        }} */}
      ><h1 class="row d-flex justify-content-center mt-5 mb-5">Muzica Pop</h1>
      <MuzicaPopBody></MuzicaPopBody>
      {/* </div> */}
    </>
  );
};

export default MuzicaPop;
